import React from "react";
import { IoMdClose } from "react-icons/io";

const UploadProducts = ({ onClose }) => {
  const [data, setData] = {
    productName: "",
    brandName: "",
    category: "",
    productImage: "",
    description: "",
    price: "",
    selling: "",
  };

  const handleOnChange = (e) => {

  };
  return (
    <div className="fixed w-full h-full bg-slate-200 bg-opacity-35 top-0 left-0 right-0 bottom-0 flex justify-center items-center">
      <div className="bg-white p-4 rounded w-full max-w-2xl h-full max-h-[80%]">
        <div className="flex justify-between items-center">
          <h2 className="font-bold text-lg"> Upload Products</h2>
          <div
            className="w-fit ml-auto cursor-pointer text-2xl hover:text-red-600"
            onClick={onClose}
          >
            <IoMdClose />
          </div>
        </div>
        <form className="grid p-4 g">
          <label htmlFor="ProductName">Product Name :</label>
          <input
            type="text"
            id="ProductName"
            placeholder="Enter Product Name"
            value={data.productName}
            onChange={handleOnChange}
            className="p-2 bg-slate-100 boder rounded "
          />
        </form>
      </div>
    </div>
  );
};

export default UploadProducts;
